import React, {Component} from "react";
import './A_bit_about_me.css';
import img from './About_me_img.png';
import img1 from './man_in_blue.png';

class A_bit_about_me extends Component {
    render() {
        return (
            <div className="Main_about">
                <div className="About_phone_pic">
                    <img src={img} alt="phone_pic_here" width={"460px"} className="phone_pic"/>
                </div>
                <div className="About_text">
                <h1><img src={img1} alt="about_me_pic" />A Bit About Me</h1>
                </div>
            </div>
        );
    }
}

export default A_bit_about_me;
